import React, { useState } from "react";
import { Form, Button } from "react-bootstrap";
import { connect } from "react-redux";
import { useEffect } from "react";
import { RegisterUserInfo } from "../redux/actions/Register_actions";
import { useNavigate } from "react-router-dom";

const Register = (props) => {
  const [employeeName, setEmployeeName] = useState("");
  const [phone, setPhone] = useState("");
  const navigate = useNavigate();

  const submit = (e) => {
    e.preventDefault();
    let data = {
      employeeName: employeeName,
      phone: phone,
    };
    console.log(data);
    // props.RegisterUserInfo(data);
    // navigate("/");
  };

  // useEffect(() => {
  //   console.log("registration", props.details);
  // }, [props]);

  return (
    <div className="reg-div">
      <Form className="reg-form">
        <Form.Group className="mb-3 reg-inbox">
          <Form.Control
            type="text"
            placeholder="Your Name"
            onChange={(e) => setEmployeeName(e.target.value)}
          />
        </Form.Group>

        <Form.Group className="mb-3 reg-inbox" controlId="formBasicEmail">
          <Form.Control
            type="text"
            placeholder="Enter Phone"
            onChange={(e) => setPhone(e.target.value)}
          />
        </Form.Group>

        <Button
          className="reg-btn"
          variant="primary"
          type="submit"
          onClick={submit}
        >
          Submit
        </Button>
      </Form>
    </div>
  );
};

const mapStateToProps = (state) => ({
  details: state.registraton,
});

const mapDispatchToProps = {
  // getUserInfo,
  RegisterUserInfo,
};

export default connect(mapStateToProps, mapDispatchToProps)(Register);
